import React from 'react';
import './Home.css';

const HomeScreen = React.forwardRef((props, ref)=>{

    check = true;
$(document).ready(function(){
    setInterval(function(){
        if(check) {
            check = false;
            $('#displayArea').html("a");
        }
        else {
            check = true
            $('#displayArea').html("b");
        }
    }, 5000);
});

    return (
        <div>
            <div id='a' className='box' ref={ref}>
                <h1 class="header fade-up">Hello!</h1>
                <h1 class="header fade-up">I'm Chianne</h1>
            </div> 

            <div id='b' className='box0' ref={ref}>
                <h1 class="header fade-up">I am a</h1>
                <h1 class="header fade-up">Software Engineer</h1>
            </div> 
        </div>
    )
}) 



export default HomeScreen;
